    return True

def find_unique_prime_combinations(numbers):
    combinations = set()
    n = len(numbers)
    for i in range(n - 2):
        for j in range(i + 1, n - 1):
            for k in range(j + 1, n):
                combination = [numbers[i], numbers[j], numbers[k]]
                if all(map(is_prime, combination)):
                    combinations.add(tuple(sorted(combination)))
    return combinations

